--
-- Table structure for table `codes`
--

CREATE TABLE IF NOT EXISTS hcpcs_codes  (
  id integer PRIMARY KEY,
  code_text varchar (255) NOT NULL default '',
  code_text_short varchar (24) NOT NULL default '',
  code varchar (10) NOT NULL default '',
  code_type smallint default NULL,
  modifier varchar (12) NOT NULL default '',
  units smallint default NULL,
  fee decimal (12,2) default NULL,
  superbill varchar (31) NOT NULL default '',
  related_code varchar (255) NOT NULL default '',
  taxrates varchar (255) NOT NULL default '',
  cyp_factor numeric NOT NULL default '0', --quantity representing a years supply'
  active char (1) default '1', -- '0 = inactive, 1 = active'
  reportable char (1) default '0', -- '0 = non-reportable, 1 = reportable'
  financial_reporting char (1) default '0' -- '0 = negative, 1 = considered important code in financial reporting'
);


